'use strict';
let SendSingleCommandWithoutResponse = require('./SendSingleCommandWithoutResponse.js');
let stdlib = require('@gehtsoft/LuaxStdlib-node').stdlib;
//@@DocBrief("The command for subscribing/unsubscribing instrument")
class InstrumentSubscribingCommand extends SendSingleCommandWithoutResponse {
    toSubscribe;
    offerIds;
    requestNumber;
    constructor() {
        super();
        this.toSubscribe = false;
        this.offerIds = null;
        this.commandName = "InstrumentSubscribingCommand";
    }
    createTransportMessage() {
        return this.messageFactory.createInstrumentSubscribingRequestMessage(this.tradingSession, this.offerIds, this.toSubscribe, this.requestNumber, stdlib.nowutc());
    }
}
module.exports = InstrumentSubscribingCommand
